import { AndréTamião, Container, Contato, GuiasContainer, Início, Logo } from "./styles";


function Header(){
    return(
        <>
        <Logo/>
        <Container>
            <GuiasContainer>
                <Início>Início</Início>
                <AndréTamião>André Tamião</AndréTamião>
                <Contato>Contato</Contato>
            </GuiasContainer>
        </Container>
        </>
    )
}

export default Header;
